            </xsl:choose>\n               <xsl:call-template name=\"groupResources\">\n                 <xsl:with-param name=\"node\" select=\"resources/resource\"/>\n               </xsl:call-template>\n             </blockquote>\n           </xsl:for-each>\n         </xsl:when>\n         <xsl:otherwise>\n           <h5>THIS US'), NULL);           
